
;====================================================================
; SONIC ADVANCED 3D - Complete Gameplay Engine
; x86 Assembly (MASM32) - Full Featured Sonic Experience
; Features: 20+ mechanics, advanced animations, particles, effects
;====================================================================

.686p
.model flat,stdcall
option casemap:none

; ============= INCLUDES =============
include \masm32\include\windows.inc
include \masm32\include\user32.inc
include \masm32\include\kernel32.inc
include \masm32\include\gdi32.inc
include \masm32\include\masm32.inc
include \masm32\include\winmm.inc

includelib \masm32\lib\winmm.lib
includelib \masm32\lib\user32.lib
includelib \masm32\lib\kernel32.lib
includelib \masm32\lib\gdi32.lib
includelib \masm32\lib\masm32.lib

include c:\masm32\macros\macros.asm

SCREEN_WIDTH equ 1920
SCREEN_HEIGHT equ 1080

; ============= CONSTANTS =============
MAX_RINGS equ 999
MAX_PARTICLES equ 500
MAX_ENEMIES equ 50
MAX_SPRINGS equ 30
MAX_RAILS equ 20
MAX_CHECKPOINTS equ 15

; Animation states
ANIM_IDLE equ 0
ANIM_WALK equ 1
ANIM_RUN equ 2
ANIM_JUMP equ 3
ANIM_SPIN_DASH equ 4
ANIM_BOOST equ 5
ANIM_HOMING_ATTACK equ 6
ANIM_GRIND equ 7
ANIM_WALL_RUN equ 8
ANIM_TRICK equ 9
ANIM_DRIFT equ 10
ANIM_DROP_DASH equ 11
ANIM_STOMP equ 12
ANIM_HURT equ 13
ANIM_SUPER equ 14

; Power-up types
POWERUP_SPEED_SHOES equ 1
POWERUP_INVINCIBILITY equ 2
POWERUP_SHIELD_NORMAL equ 3
POWERUP_SHIELD_FIRE equ 4
POWERUP_SHIELD_ELECTRIC equ 5
POWERUP_ENERGY_FIELD equ 6

; ============= STRUCTURES =============

vec3 struct
    x dd 0.0
    y dd 0.0
    z dd 0.0
vec3 ends

vertex_advanced struct
    x dd 0.0
    y dd 0.0
    z dd 0.0
    nx dd 0.0
    ny dd 0.0
    nz dd 0.0
    u dd 0.0
    v dd 0.0
    r db 255
    g db 255
    b db 255
    a db 255
vertex_advanced ends

player_state struct
    ; Position & Velocity
    posX dd 0.0
    posY dd 0.0
    posZ dd 0.0
    velX dd 0.0
    velY dd 0.0
    velZ dd 0.0
    
    ; Rotation
    rotX dd 0.0
    rotY dd 0.0
    rotZ dd 0.0
    
    ; Physics
    speed dd 0.0
    acceleration dd 0.0
    max_speed dd 15.0
    boost_speed dd 30.0
    
    ; State flags
    isGrounded db 0
    isJumping db 0
    isBoosting db 0
    isSpinDashing db 0
    isGrinding db 0
    isWallRunning db 0
    isDrifting db 0
    isHomingAttack db 0
    
    ; Collectibles
    rings dd 0
    lives dd 3
    score dd 0
    
    ; Animation
    animState dd ANIM_IDLE
    animFrame dd 0.0
    animSpeed dd 0.3
    prevAnimState dd 0
    
    ; Power-ups
    hasSpeedShoes db 0
    hasInvincibility db 0
    shieldType db 0
    hasEnergyField db 0
    isSuperSonic db 0
    
    ; Timers
    boostTimer dd 0
    invincibilityTimer dd 0
    speedShoesTimer dd 0
    spinChargeTimer dd 0
    homingCooldown dd 0
    trickTimer dd 0
    
    ; Combo system
    trickPoints dd 0
    comboMultiplier dd 1
    airTime dd 0
    
    ; Movement modifiers
    driftAngle dd 0.0
    wallNormalX dd 0.0
    wallNormalY dd 0.0
    wallNormalZ dd 0.0
player_state ends

ring struct
    x dd 0.0
    y dd 0.0
    z dd 0.0
    active db 1
    rotationAngle dd 0.0
    collectTimer dd 0
ring ends

particle struct
    x dd 0.0
    y dd 0.0
    z dd 0.0
    vx dd 0.0
    vy dd 0.0
    vz dd 0.0
    life dd 100
    maxLife dd 100
    r db 255
    g db 255
    b db 255
    size dd 2
    particleType db 0
particle ends

spring_pad struct
    x dd 0.0
    y dd 0.0
    z dd 0.0
    power dd 20.0
    angleX dd 0.0
    angleY dd 0.0
    active db 1
spring_pad ends

grind_rail struct
    startX dd 0.0
    startY dd 0.0
    startZ dd 0.0
    endX dd 0.0
    endY dd 0.0
    endZ dd 0.0
    progress dd 0.0
    active db 1
grind_rail ends

camera_advanced struct
    posX dd 0.0
    posY dd 15.0
    posZ dd -25.0
    targetX dd 0.0
    targetY dd 0.0
    targetZ dd 0.0
    distance dd 20.0
    angleX dd 0.3
    angleY dd 0.0
    smoothness dd 0.15
    fov dd 75.0
    shake_intensity dd 0.0
camera_advanced ends

; ============= DATA SECTION =============
.data

hInstance HINSTANCE ?
CommandLine LPSTR ?

ClassName db "SONIC",0
WindowTitle db "SONIC",0

deltaTime dd 16
lastTime dd 0
frameCount dd 0
gameTime dd 0

; Player
plr player_state <>

; Camera
cam camera_advanced <>

; Collections
rings ring MAX_RINGS dup(<>)
particles particle MAX_PARTICLES dup(<>)
springs spring_pad MAX_SPRINGS dup(<>)
rails grind_rail MAX_RAILS dup(<>)

ringCount dd 0
particleCount dd 0
springCount dd 0
railCount dd 0

; Physics constants
gravity dd -0.8
jumpPower dd 12.0
walkSpeed dd 6.0
runSpeed dd 15.0
boostSpeed dd 35.0
spinDashMaxPower dd 25.0
homingAttackSpeed dd 20.0
wallRunSpeed dd 10.0
driftFriction dd 0.85
airFriction dd 0.98
groundFriction dd 0.92

; Math constants
PI dd 3.14159265
TWO_PI dd 6.28318530
const_zero dd 0.0
const_one dd 1.0
const_half dd 0.5
const_360 dd 360.0

; Colors
color_sonic_blue dd 000080FFh
color_sonic_skin dd 00FFE0C0h
color_ring_gold dd 0000FFFFh
color_boost_trail dd 0080FFFFh
color_super_gold dd 0000D7FFh
color_shield_blue dd 00FF8000h
color_invincible dd 00FF00FFh

