.code

start:
    invoke GetModuleHandle, NULL
    mov hInstance, eax
    invoke GetCommandLine
    invoke WinMain, hInstance, NULL, CommandLine, SW_SHOWDEFAULT
    invoke ExitProcess, eax

WinMain proc hInst:HINSTANCE, hPrevInst:HINSTANCE, CmdLine:LPSTR, CmdShow:DWORD
    LOCAL wc:WNDCLASSEX
    LOCAL msg:MSG
    LOCAL hwnd:HWND
    LOCAL hdc:HDC
    LOCAL hdcBack:HDC
    LOCAL hBitmap:HBITMAP

    mov wc.cbSize, SIZEOF WNDCLASSEX
    mov wc.style, CS_HREDRAW or CS_VREDRAW
    mov wc.lpfnWndProc, offset WndProc
    mov wc.cbClsExtra, 0
    mov wc.cbWndExtra, 0
    push hInst
    pop wc.hInstance
    mov wc.hbrBackground, NULL
    mov wc.lpszMenuName, NULL
    mov wc.lpszClassName, offset ClassName

    invoke LoadIcon, NULL, IDI_APPLICATION
    mov wc.hIcon, eax
    mov wc.hIconSm, eax
    invoke LoadCursor, NULL, IDC_ARROW
    mov wc.hCursor, eax

    invoke RegisterClassEx, addr wc

    invoke CreateWindowEx, WS_EX_TOPMOST, ADDR ClassName, ADDR WindowTitle, \
           WS_POPUP, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT, NULL, NULL, hInst, NULL
    mov hwnd, eax

    invoke ShowWindow, hwnd, SW_SHOW
    invoke UpdateWindow, hwnd
    invoke ShowCursor, FALSE

    invoke InitGame

    invoke GetDC, hwnd
    mov hdc, eax
    invoke CreateCompatibleDC, hdc
    mov hdcBack, eax
    invoke CreateCompatibleBitmap, hdc, SCREEN_WIDTH, SCREEN_HEIGHT
    mov hBitmap, eax
    invoke SelectObject, hdcBack, hBitmap

    .WHILE TRUE
        invoke PeekMessage, ADDR msg, NULL, 0, 0, PM_REMOVE
        .BREAK .IF msg.message == WM_QUIT

        invoke TranslateMessage, ADDR msg
        invoke DispatchMessage, ADDR msg

        .IF isPaused == 0
            invoke UpdateGame
            invoke RenderGame, hdc, hdcBack
        .ENDIF
    .ENDW

    mov eax, msg.wParam
    ret
WinMain endp

WndProc proc hWnd:HWND, uMsg:UINT, wParam:WPARAM, lParam:LPARAM
    .IF uMsg == WM_KEYDOWN
        .IF wParam == VK_ESCAPE
            invoke PostQuitMessage, 0
        .ELSEIF wParam == 'W'
            mov keyW, 1
        .ELSEIF wParam == 'A'
            mov keyA, 1
        .ELSEIF wParam == 'S'
            mov keyS, 1
        .ELSEIF wParam == 'D'
            mov keyD, 1
        .ELSEIF wParam == VK_SPACE
            mov keySpace, 1
        .ELSEIF wParam == VK_SHIFT
            mov keyShift, 1
        .ELSEIF wParam == VK_CONTROL
            mov keyCtrl, 1
        .ELSEIF wParam == 'Q'
            mov keyQ, 1
        .ELSEIF wParam == 'E'
            mov keyE, 1
        .ELSEIF wParam == '1'
            mov key1, 1
        .ELSEIF wParam == '2'
            mov key2, 1
        .ELSEIF wParam == '3'
            mov key3, 1
        .ELSEIF wParam == 'P'
            xor isPaused, 1
        .ELSEIF wParam == 'F1'
            xor showDebug, 1
        .ENDIF
        xor eax, eax
        ret
    .ELSEIF uMsg == WM_KEYUP
        .IF wParam == 'W'
            mov keyW, 0
        .ELSEIF wParam == 'A'
            mov keyA, 0
        .ELSEIF wParam == 'S'
            mov keyS, 0
        .ELSEIF wParam == 'D'
            mov keyD, 0
        .ELSEIF wParam == VK_SPACE
            mov keySpace, 0
        .ELSEIF wParam == VK_SHIFT
            mov keyShift, 0
        .ELSEIF wParam == VK_CONTROL
            mov keyCtrl, 0
        .ELSEIF wParam == 'Q'
            mov keyQ, 0
        .ELSEIF wParam == 'E'
            mov keyE, 0
        .ENDIF
        xor eax, eax
        ret
    .ELSEIF uMsg == WM_DESTROY
        invoke PostQuitMessage, 0
        xor eax, eax
        ret
    .ELSE
        invoke DefWindowProc, hWnd, uMsg, wParam, lParam
        ret
    .ENDIF
WndProc endp

; ============= INITIALIZATION =============

InitGame proc
    invoke InitPlayer
    invoke InitCamera
    invoke InitRings
    invoke InitSprings
    invoke InitRails
    invoke InitParticles
    ret
InitGame endp

InitPlayer proc
    fldz
    fstp plr.posX
    fstp plr.posY
    fstp plr.posZ
    fstp plr.velX
    fstp plr.velY
    fstp plr.velZ
    fstp plr.rotY
    fstp plr.speed
    
    mov plr.rings, 0
    mov plr.lives, 3
    mov plr.score, 0
    mov plr.animState, ANIM_IDLE
    mov plr.isGrounded, 1
    
    fld const_one
    fld const_one
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fstp plr.max_speed
    
    ; Inicializar modelo do GLB
    invoke InitSonicModel
    
    ret
InitPlayer endp

InitSonicModel proc
    LOCAL i:DWORD
    
    ; Inicializar hierarquia de nodes (163 nodes do GLB)
    ; Node 0: Armature (root)
    ; Node 95: Null_68 (corpo principal)
    ; Node 96: Hips_63
    ; Nodes 97-162: Braços, pernas, dedos, cabeça, etc.
    
    mov i, 0
init_nodes_loop:
    mov eax, i
    cmp eax, 163
    jge init_nodes_done
    
    ; Configurar parent relationships baseado no GLB
    ; (simplificado - em produção viria do arquivo GLB)
    mov ebx, eax
    cmp ebx, 0
    je set_root
    
    ; Hips (96) -> parent é Null_68 (95)
    cmp ebx, 96
    je set_hips_parent
    
    ; Padrão: parent é o anterior
    dec eax
    jmp set_parent
    
set_root:
    mov eax, -1
    jmp set_parent
    
set_hips_parent:
    mov eax, 95
    
set_parent:
    mov ebx, i
    imul ebx, 4
    lea esi, [node_parent + ebx]
    mov [esi], eax
    
    inc i
    jmp init_nodes_loop
    
init_nodes_done:
    
    ; Inicializar 69 bones com matrizes identidade
    mov i, 0
init_bones_loop:
    mov eax, i
    cmp eax, 69
    jge init_bones_done
    
    ; Matriz identidade 4x4
    mov ebx, eax
    imul ebx, 64  ; 16 floats × 4 bytes
    lea esi, [bone_matrices + ebx]
    
    ; [0,0] = 1.0
    fld const_one
    fstp REAL4 PTR [esi]
    ; [1,1] = 1.0
    fld const_one
    fstp REAL4 PTR [esi + 20]
    ; [2,2] = 1.0
    fld const_one
    fstp REAL4 PTR [esi + 40]
    ; [3,3] = 1.0
    fld const_one
    fstp REAL4 PTR [esi + 60]
    
    inc i
    jmp init_bones_loop
    
init_bones_done:
    
    ; Inicializar meshes (49 meshes do GLB)
    ; Mesh 0: Body vertices
    mov dword ptr [mesh_vertex_offset], 0
    mov dword ptr [mesh_vertex_count], 497
    
    ; Mesh 1: Head
    mov dword ptr [mesh_vertex_offset + 4], 497
    mov dword ptr [mesh_vertex_count + 4], 563
    
    ; Mesh 2-48: Arms, Legs, Hands, Fingers, Eyes, etc.
    ; (simplificado - dados completos viriam do GLB)
    
    ret
InitSonicModel endp

InitCamera proc
    fldz
    fstp cam.posX
    fld PI
    fld const_half
    fmul
    fstp cam.posY
    fld cam.distance
    fchs
    fstp cam.posZ
    ret
InitCamera endp

InitRings proc
    LOCAL i:DWORD
    mov i, 0
    mov ringCount, 50
    
init_ring_loop:
    mov eax, i
    cmp eax, 50
    jge init_rings_done
    
    ; Position rings in a path
    mov ebx, SIZEOF ring
    mul ebx
    lea esi, [rings + eax]
    
    fild i
    fld const_one
    fld const_one
    fadd
    fmul
    fstp REAL4 PTR [esi + ring.x]
    
    fld const_one
    fstp REAL4 PTR [esi + ring.y]
    
    fldz
    fstp REAL4 PTR [esi + ring.z]
    
    mov byte ptr [esi + ring.active], 1
    
    inc i
    jmp init_ring_loop
    
init_rings_done:
    ret
InitRings endp

InitSprings proc
    mov springCount, 5
    ret
InitSprings endp

InitRails proc
    mov railCount, 3
    ret
InitRails endp

InitParticles proc
    mov particleCount, 0
    ret
InitParticles endp

; ============= GAME UPDATE =============

UpdateGame proc
    invoke GetDeltaTime
    invoke ProcessAdvancedInput
    invoke UpdatePlayerPhysics
    invoke UpdatePlayerState
    invoke UpdatePowerUps
    invoke UpdateRings
    invoke UpdateParticles
    invoke UpdateCamera
    invoke CheckCollisions
    invoke UpdateAnimations
    ret
UpdateGame endp

GetDeltaTime proc
    invoke timeGetTime
    mov ebx, lastTime
    mov lastTime, eax
    sub eax, ebx
    
    cmp eax, 0
    je delta_min
    cmp eax, 100
    jle delta_ok
    mov eax, 16
    jmp delta_ok
delta_min:
    mov eax, 16
delta_ok:
    mov deltaTime, eax
    add gameTime, eax
    ret
GetDeltaTime endp

ProcessAdvancedInput proc
    LOCAL moveX:REAL4
    LOCAL moveZ:REAL4
    LOCAL speed:REAL4
    
    fldz
    fstp moveX
    fstp moveZ
    
    ; Movement
    .IF keyW == 1
        fld const_one
        fld moveZ
        fadd
        fstp moveZ
    .ENDIF
    
    .IF keyS == 1
        fld const_one
        fchs
        fld moveZ
        fadd
        fstp moveZ
    .ENDIF
    
    .IF keyA == 1
        fld const_one
        fchs
        fld moveX
        fadd
        fstp moveX
    .ENDIF
    
    .IF keyD == 1
        fld const_one
        fld moveX
        fadd
        fstp moveX
    .ENDIF
    
    ; Speed boost
    .IF keyShift == 1
        .IF plr.rings >= 5
            mov plr.isBoosting, 1
            mov plr.animState, ANIM_BOOST
        .ENDIF
    .ELSE
        mov plr.isBoosting, 0
    .ENDIF
    
    ; Spin dash
    .IF keyCtrl == 1
        .IF plr.isGrounded == 1
            mov plr.isSpinDashing, 1
            mov plr.animState, ANIM_SPIN_DASH
            inc plr.spinChargeTimer
        .ENDIF
    .ELSE
        .IF plr.isSpinDashing == 1
            ; Release spin dash
            mov plr.isSpinDashing, 0
            fild plr.spinChargeTimer
            fld spinDashMaxPower
            fmul
            fstp plr.velX
            mov plr.spinChargeTimer, 0
        .ENDIF
    .ENDIF
    
    ; Homing attack
    .IF keyQ == 1
        .IF plr.isGrounded == 0
            .IF plr.homingCooldown == 0
                mov plr.isHomingAttack, 1
                mov plr.animState, ANIM_HOMING_ATTACK
                mov plr.homingCooldown, 30
            .ENDIF
        .ENDIF
    .ENDIF
    
    ; Tricks
    .IF keyE == 1
        .IF plr.isGrounded == 0
            mov plr.animState, ANIM_TRICK
            add plr.trickPoints, 100
            inc plr.comboMultiplier
        .ENDIF
    .ENDIF
    
    ; Apply movement
    fld moveX
    fmul st(0), st(0)
    fld moveZ
    fmul st(0), st(0)
    fadd
    fsqrt
    fst temp_float
    
    fldz
    fld temp_float
    fcomip st(0), st(1)
    fstp st(0)
    jbe skip_movement
    
    fld moveX
    fld temp_float
    fdiv
    fstp moveX
    
    fld moveZ
    fld temp_float
    fdiv
    fstp moveZ
    
    ; Determine speed
    .IF plr.isBoosting == 1
        fld boostSpeed
    .ELSEIF keyShift == 1
        fld runSpeed
    .ELSE
        fld walkSpeed
    .ENDIF
    fstp speed
    
    fld moveX
    fld speed
    fmul
    fld plr.velX
    fadd
    fstp plr.velX
    
    fld moveZ
    fld speed
    fmul
    fld plr.velZ
    fadd
    fstp plr.velZ
    
skip_movement:
    ; Jump
    .IF keySpace == 1
        .IF plr.isGrounded == 1
            fld jumpPower
            fstp plr.velY
            mov plr.isGrounded, 0
            mov plr.isJumping, 1
            mov plr.animState, ANIM_JUMP
        .ENDIF
    .ENDIF
    
    ret
ProcessAdvancedInput endp

UpdatePlayerPhysics proc
    LOCAL deltaT:REAL4
    
    fild deltaTime
    fld const_one
    fld const_one
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fdiv
    fstp deltaT
    
    ; Apply gravity
    fld gravity
    fld deltaT
    fmul
    fld plr.velY
    fadd
    fstp plr.velY
    
    ; Apply friction
    .IF plr.isGrounded == 1
        fld plr.velX
        fld groundFriction
        fmul
        fstp plr.velX
        
        fld plr.velZ
        fld groundFriction
        fmul
        fstp plr.velZ
    .ELSE
        fld plr.velX
        fld airFriction
        fmul
        fstp plr.velX
        
        fld plr.velZ
        fld airFriction
        fmul
        fstp plr.velZ
    .ENDIF
    
    ; Update position
    fld plr.velX
    fld deltaT
    fmul
    fld plr.posX
    fadd
    fstp plr.posX
    
    fld plr.velY
    fld deltaT
    fmul
    fld plr.posY
    fadd
    fstp plr.posY
    
    fld plr.velZ
    fld deltaT
    fmul
    fld plr.posZ
    fadd
    fstp plr.posZ
    
    ; Calculate speed
    fld plr.velX
    fmul st(0), st(0)
    fld plr.velZ
    fmul st(0), st(0)
    fadd
    fsqrt
    fstp plr.speed
    
    ; Ground check
    fld plr.posY
    fld const_zero
    fcomip st(0), st(1)
    fstp st(0)
    ja not_on_ground
    
    fldz
    fstp plr.posY
    fstp plr.velY
    mov plr.isGrounded, 1
    mov plr.isJumping, 0
    jmp ground_check_done
    
not_on_ground:
    mov plr.isGrounded, 0
    
ground_check_done:
    ret
UpdatePlayerPhysics endp

UpdatePlayerState proc
    ; Update animation state based on movement
    .IF plr.isSpinDashing == 1
        mov plr.animState, ANIM_SPIN_DASH
    .ELSEIF plr.isBoosting == 1
        mov plr.animState, ANIM_BOOST
    .ELSEIF plr.isHomingAttack == 1
        mov plr.animState, ANIM_HOMING_ATTACK
    .ELSEIF plr.isJumping == 1
        mov plr.animState, ANIM_JUMP
    .ELSEIF plr.isGrounded == 1
        fld plr.speed
        fld const_one
        fcomip st(0), st(1)
        fstp st(0)
        jb set_idle
        
        fld plr.speed
        fld runSpeed
        fld const_half
        fmul
        fcomip st(0), st(1)
        fstp st(0)
        ja set_run
        
        mov plr.animState, ANIM_WALK
        jmp state_done
        
set_run:
        mov plr.animState, ANIM_RUN
        jmp state_done
        
set_idle:
        mov plr.animState, ANIM_IDLE
    .ENDIF
    
state_done:
    ret
UpdatePlayerState endp

UpdatePowerUps proc
    ; Decrease timers
    .IF plr.boostTimer > 0
        dec plr.boostTimer
    .ELSE
        mov plr.isBoosting, 0
    .ENDIF
    
    .IF plr.invincibilityTimer > 0
        dec plr.invincibilityTimer
    .ELSE
        mov plr.hasInvincibility, 0
    .ENDIF
    
    .IF plr.speedShoesTimer > 0
        dec plr.speedShoesTimer
    .ELSE
        mov plr.hasSpeedShoes, 0
    .ENDIF
    
    .IF plr.homingCooldown > 0
        dec plr.homingCooldown
    .ENDIF
    
    ret
UpdatePowerUps endp

UpdateRings proc
    LOCAL i:DWORD
    mov i, 0
    
update_rings_loop:
    mov eax, i
    cmp eax, ringCount
    jge update_rings_done
    
    mov ebx, SIZEOF ring
    mul ebx
    lea esi, [rings + eax]
    
    cmp byte ptr [esi + ring.active], 0
    je next_ring
    
    ; Rotate ring
    fld REAL4 PTR [esi + ring.rotationAngle]
    fld const_one
    fld const_one
    fadd
    fdiv
    fadd
    fstp REAL4 PTR [esi + ring.rotationAngle]
    
    ; Check collection
    fld plr.posX
    fld REAL4 PTR [esi + ring.x]
    fsub
    fabs
    fld const_one
    fcomip st(0), st(1)
    fstp st(0)
    ja next_ring
    
    fld plr.posY
    fld REAL4 PTR [esi + ring.y]
    fsub
    fabs
    fld const_one
    fcomip st(0), st(1)
    fstp st(0)
    ja next_ring
    
    fld plr.posZ
    fld REAL4 PTR [esi + ring.z]
    fsub
    fabs
    fld const_one
    fcomip st(0), st(1)
    fstp st(0)
    ja next_ring
    
    ; Collect ring
    mov byte ptr [esi + ring.active], 0
    inc plr.rings
    add plr.score, 10
    invoke CreateRingParticles, REAL4 PTR [esi + ring.x], REAL4 PTR [esi + ring.y], REAL4 PTR [esi + ring.z]
    
next_ring:
    inc i
    jmp update_rings_loop
    
update_rings_done:
    ret
UpdateRings endp

UpdateParticles proc
    LOCAL i:DWORD
    mov i, 0
    
update_particle_loop:
    mov eax, i
    cmp eax, particleCount
    jge update_particles_done
    
    mov ebx, SIZEOF particle
    mul ebx
    lea esi, [particles + eax]
    
    ; Update position
    fld REAL4 PTR [esi + particle.vx]
    fld REAL4 PTR [esi + particle.x]
    fadd
    fstp REAL4 PTR [esi + particle.x]
    
    fld REAL4 PTR [esi + particle.vy]
    fld REAL4 PTR [esi + particle.y]
    fadd
    fstp REAL4 PTR [esi + particle.y]
    
    fld REAL4 PTR [esi + particle.vz]
    fld REAL4 PTR [esi + particle.z]
    fadd
    fstp REAL4 PTR [esi + particle.z]
    
    ; Apply gravity to particles
    fld gravity
    fld const_one
    fld const_one
    fadd
    fdiv
    fmul
    fld REAL4 PTR [esi + particle.vy]
    fadd
    fstp REAL4 PTR [esi + particle.vy]
    
    ; Decrease life
    mov eax, dword ptr [esi + particle.life]
    dec eax
    mov dword ptr [esi + particle.life], eax
    
    inc i
    jmp update_particle_loop
    
update_particles_done:
    ret
UpdateParticles endp

UpdateCamera proc
    LOCAL angleRad:REAL4
    LOCAL targetPosX:REAL4
    LOCAL targetPosY:REAL4
    LOCAL targetPosZ:REAL4
    
    ; Calculate ideal camera position
    fld plr.posX
    fstp targetPosX
    
    fld plr.posY
    fld const_one
    fld const_one
    fadd
    fadd
    fstp targetPosY
    
    fld plr.posZ
    fstp targetPosZ
    
    fld cam.angleY
    fstp angleRad
    
    ; Smooth camera movement
    fld angleRad
    fsin
    fld cam.distance
    fmul
    fld targetPosX
    fadd
    fld cam.posX
    fsub
    fld cam.smoothness
    fmul
    fld cam.posX
    fadd
    fstp cam.posX
    
    fld cam.angleX
    fld targetPosY
    fadd
    fld cam.posY
    fsub
    fld cam.smoothness
    fmul
    fld cam.posY
    fadd
    fstp cam.posY
    
    fld angleRad
    fcos
    fld cam.distance
    fmul
    fld targetPosZ
    fadd
    fld cam.posZ
    fsub
    fld cam.smoothness
    fmul
    fld cam.posZ
    fadd
    fstp cam.posZ
    
    ; Set target
    fld targetPosX
    fstp cam.targetX
    fld targetPosY
    fstp cam.targetY
    fld targetPosZ
    fstp cam.targetZ
    
    ret
UpdateCamera endp

CheckCollisions proc
    ; Placeholder for advanced collision system
