CheckCollisions endp

UpdateAnimations proc
    LOCAL deltaT:REAL4
    LOCAL maxFrames:DWORD
    LOCAL boneIdx:DWORD
    LOCAL frameBlend:REAL4
    
    fild deltaTime
    fld const_one
    fld const_one
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fadd
    fdiv
    fstp deltaT
    
    ; Get max frames for current animation (baseado no vídeo do YouTube)
    mov eax, plr.animState
    .IF eax == ANIM_IDLE
        mov maxFrames, 16
    .ELSEIF eax == ANIM_WALK
        mov maxFrames, 24
    .ELSEIF eax == ANIM_RUN
        mov maxFrames, 12
    .ELSEIF eax == ANIM_JUMP
        mov maxFrames, 8
    .ELSEIF eax == ANIM_SPIN_DASH
        mov maxFrames, 6
    .ELSEIF eax == ANIM_BOOST
        mov maxFrames, 10
    .ELSEIF eax == ANIM_HOMING_ATTACK
        mov maxFrames, 8
    .ELSEIF eax == ANIM_GRIND
        mov maxFrames, 8
    .ELSEIF eax == ANIM_WALL_RUN
        mov maxFrames, 10
    .ELSEIF eax == ANIM_TRICK
        mov maxFrames, 12
    .ELSEIF eax == ANIM_DRIFT
        mov maxFrames, 8
    .ELSEIF eax == ANIM_DROP_DASH
        mov maxFrames, 6
    .ELSEIF eax == ANIM_STOMP
        mov maxFrames, 6
    .ELSEIF eax == ANIM_HURT
        mov maxFrames, 4
    .ELSEIF eax == ANIM_SUPER
        mov maxFrames, 20
    .ELSE
        mov maxFrames, 8
    .ENDIF
    
    ; Update frame
    fld plr.animFrame
    fld deltaT
    fld plr.animSpeed
    fmul
    fadd
    fstp plr.animFrame
    
    ; Calculate blend factor
    fld plr.animFrame
    fist temp_int
    fisub temp_int
    fstp frameBlend
    
    ; Loop animation
    fld plr.animFrame
    fild maxFrames
    fcomip st(0), st(1)
    fstp st(0)
    jb anim_ok
    
    fldz
    fstp plr.animFrame
    
anim_ok:
    ; Atualizar bones com base na animação atual
    ; Sistema de skeletal animation inspirado no vídeo
    invoke UpdateSkeletalAnimation, plr.animState, plr.animFrame, frameBlend
    
    ret
UpdateAnimations endp

UpdateSkeletalAnimation proc uses ebx esi edi, animState:DWORD, frame:REAL4, blend:REAL4
    LOCAL boneIdx:DWORD
    LOCAL angle:REAL4
    
    mov boneIdx, 0
    
update_bone_loop:
    mov eax, boneIdx
    cmp eax, 69
    jge update_bones_done
    
    ; Calcular rotação baseada no estado de animação
    mov ebx, animState
    
    .IF ebx == ANIM_WALK
        ; Animar pernas alternadamente
        mov eax, boneIdx
        ; Bone 117: Right Leg
        cmp eax, 117
        je animate_right_leg
        ; Bone 122: Left Leg
        cmp eax, 122
        je animate_left_leg
        jmp next_bone
        
animate_right_leg:
        fld frame
        fld TWO_PI
        fmul
        fsin
        fstp angle
        ; Aplicar rotação ao bone
        invoke ApplyBoneRotation, 117, angle, 0.0, 0.0
        jmp next_bone
        
animate_left_leg:
        fld frame
        fld TWO_PI
        fmul
        fld PI
        fadd
        fsin
        fstp angle
        invoke ApplyBoneRotation, 122, angle, 0.0, 0.0
        jmp next_bone
        
    .ELSEIF ebx == ANIM_RUN
        ; Animação de corrida mais rápida
        mov eax, boneIdx
        cmp eax, 117
        je animate_run_right
        cmp eax, 122
        je animate_run_left
        ; Braços também se movem
        cmp eax, 111  ; Right Arm
        je animate_right_arm
        cmp eax, 105  ; Left Arm
        je animate_left_arm
        jmp next_bone
        
animate_run_right:
        fld frame
        fld TWO_PI
        fld const_one
        fld const_one
        fadd
        fmul
        fmul
        fsin
        fstp angle
        invoke ApplyBoneRotation, 117, angle, 0.0, 0.0
        jmp next_bone
        
animate_run_left:
        fld frame
        fld TWO_PI
        fld const_one
        fld const_one
        fadd
        fmul
        fmul
        fld PI
        fadd
        fsin
        fstp angle
        invoke ApplyBoneRotation, 122, angle, 0.0, 0.0
        jmp next_bone
        
animate_right_arm:
        fld frame
        fld TWO_PI
        fmul
        fld PI
        fadd
        fsin
        fstp angle
        invoke ApplyBoneRotation, 111, angle, 0.0, 0.0
        jmp next_bone
        
animate_left_arm:
        fld frame
        fld TWO_PI
        fmul
        fsin
        fstp angle
        invoke ApplyBoneRotation, 105, angle, 0.0, 0.0
        jmp next_bone
        
    .ELSEIF ebx == ANIM_SPIN_DASH
        ; Rotação completa do corpo
        fld frame
        fld TWO_PI
        fld const_one
        fld const_one
        fadd
        fadd
        fadd
        fmul
        fmul
        fstp angle
        invoke ApplyBoneRotation, 96, 0.0, angle, 0.0  ; Hips
        jmp next_bone
        
    .ELSEIF ebx == ANIM_SUPER
        ; Animação especial Super Sonic
        fld frame
        fld TWO_PI
        fmul
        fsin
        fstp angle
        invoke ApplyBoneRotation, 98, 0.0, 0.0, angle  ; Head
        
    .ENDIF
    
next_bone:
    inc boneIdx
    jmp update_bone_loop
    
update_bones_done:
    ret
UpdateSkeletalAnimation endp

ApplyBoneRotation proc uses ebx esi, boneId:DWORD, angleX:REAL4, angleY:REAL4, angleZ:REAL4
    ; Aplicar rotação Euler ao bone especificado
    ; (simplificado - em produção usaria quaternions)
    mov eax, boneId
    imul eax, 64
    lea esi, [bone_matrices + eax]
    
    ; Atualizar matriz de rotação
    ; [0,0] = cos(angleY) * cos(angleZ)
    fld angleY
    fcos
    fld angleZ
    fcos
    fmul
    fstp REAL4 PTR [esi]
    
    ; Outras entradas da matriz...
    ; (implementação completa necessária)
    
    ret
ApplyBoneRotation endp

CreateRingParticles proc x:REAL4, y:REAL4, z:REAL4
    LOCAL i:DWORD
    mov i, 0
    
create_particles_loop:
    cmp i, 10
    jge create_particles_done
    cmp particleCount, MAX_PARTICLES
    jge create_particles_done
    
    mov eax, particleCount
    mov ebx, SIZEOF particle
    mul ebx
    lea esi, [particles + eax]
    
    fld x
    fstp REAL4 PTR [esi + particle.x]
    fld y
    fstp REAL4 PTR [esi + particle.y]
    fld z
    fstp REAL4 PTR [esi + particle.z]
    
    ; Random velocity
    invoke GetTickCount
    and eax, 0FFh
    mov temp_int, eax
    fild temp_int
    fld const_one
    fld const_one
    fadd
    fadd
    fadd
    fadd
    fdiv
    fstp REAL4 PTR [esi + particle.vx]
    
    fld const_one
    fld const_one
    fadd
    fstp REAL4 PTR [esi + particle.vy]
    
    fldz
    fstp REAL4 PTR [esi + particle.vz]
    
    mov dword ptr [esi + particle.life], 30
    mov dword ptr [esi + particle.maxLife], 30
    mov byte ptr [esi + particle.r], 255
    mov byte ptr [esi + particle.g], 215
    mov byte ptr [esi + particle.b], 0
    
    inc particleCount
    inc i
    jmp create_particles_loop
    
create_particles_done:
    ret
CreateRingParticles endp

; ============= RENDERING =============

RenderGame proc hdc:HDC, hdcBack:HDC
    LOCAL hBrush:HBRUSH
    LOCAL oldBrush:HBRUSH
    LOCAL hPen:HPEN
    LOCAL oldPen:HPEN
    
    ; Clear screen
    invoke BitBlt, hdcBack, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT, 0, 0, 0, BLACKNESS
    
    ; Draw sky gradient
    invoke RenderSky, hdcBack
    
    ; Draw ground
    invoke RenderGround, hdcBack
    
    ; Draw rings
    invoke RenderRings, hdcBack
    
    ; Draw particles
    invoke RenderParticles, hdcBack
    
    ; Draw player
    invoke RenderPlayer, hdcBack
    
    ; Draw HUD
    invoke RenderHUD, hdcBack
    
    ; Flip buffer
    invoke BitBlt, hdc, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT, hdcBack, 0, 0, SRCCOPY
    
    inc frameCount
    ret
RenderGame endp

RenderSky proc hdcBack:HDC
    LOCAL hBrush:HBRUSH
    LOCAL oldBrush:HBRUSH
    
    invoke CreateSolidBrush, 0087CEEBh
    mov hBrush, eax
    invoke SelectObject, hdcBack, hBrush
    mov oldBrush, eax
    invoke Rectangle, hdcBack, 0, 0, SCREEN_WIDTH, SCREEN_HEIGHT/2
    invoke SelectObject, hdcBack, oldBrush
    invoke DeleteObject, hBrush
    ret
RenderSky endp

RenderGround proc hdcBack:HDC
    LOCAL hBrush:HBRUSH
    LOCAL oldBrush:HBRUSH
    
    invoke CreateSolidBrush, 00228B22h
    mov hBrush, eax
    invoke SelectObject, hdcBack, hBrush
    mov oldBrush, eax
    invoke Rectangle, hdcBack, 0, SCREEN_HEIGHT/2, SCREEN_WIDTH, SCREEN_HEIGHT
    invoke SelectObject, hdcBack, oldBrush
    invoke DeleteObject, hBrush
    ret
RenderGround endp

RenderRings proc hdcBack:HDC
    LOCAL i:DWORD
    LOCAL screenX:DWORD
    LOCAL screenY:DWORD
    LOCAL hPen:HPEN
    LOCAL oldPen:HPEN
    LOCAL hBrush:HBRUSH
    LOCAL oldBrush:HBRUSH
    
    invoke CreatePen, PS_SOLID, 2, color_ring_gold
    mov hPen, eax
    invoke SelectObject, hdcBack, hPen
    mov oldPen, eax
    
    invoke CreateSolidBrush, color_ring_gold
    mov hBrush, eax
    invoke SelectObject, hdcBack, hBrush
    mov oldBrush, eax
    
    mov i, 0
    
render_rings_loop:
    mov eax, i
    cmp eax, ringCount
    jge render_rings_done
    
    mov ebx, SIZEOF ring
    mul ebx
    lea esi, [rings + eax]
    
    cmp byte ptr [esi + ring.active], 0
    je next_ring_render
    
    ; Simple 2D projection
    fld REAL4 PTR [esi + ring.x]
    fld plr.posX
    fsub
    fld const_one
    fld const_one
    fadd
    fld const_one
    fadd
    fmul
    mov temp_int, SCREEN_WIDTH/2
    fiadd temp_int
    fistp screenX
    
    fld REAL4 PTR [esi + ring.y]
    fchs
    fld const_one
    fld const_one
    fadd
    fld const_one
    fadd
    fmul
    mov temp_int, SCREEN_HEIGHT*2/3
    fiadd temp_int
    fistp screenY
    
    mov eax, screenX
    sub eax, 8
    mov ebx, screenY
    sub ebx, 8
    mov ecx, screenX
    add ecx, 8
    mov edx, screenY
    add edx, 8
    invoke Ellipse, hdcBack, eax, ebx, ecx, edx
    
next_ring_render:
    inc i
    jmp render_rings_loop
    
render_rings_done:
    invoke SelectObject, hdcBack, oldBrush
    invoke DeleteObject, hBrush
    invoke SelectObject, hdcBack, oldPen
    invoke DeleteObject, hPen
    ret
RenderRings endp

RenderParticles proc hdcBack:HDC
    LOCAL i:DWORD
    LOCAL screenX:DWORD
    LOCAL screenY:DWORD
    
    mov i, 0
    
render_particles_loop:
    mov eax, i
    cmp eax, particleCount
    jge render_particles_done
    
    mov ebx, SIZEOF particle
    mul ebx
    lea esi, [particles + eax]
    
    cmp dword ptr [esi + particle.life], 0
    jle next_particle_render
    
    ; Project to screen
    fld REAL4 PTR [esi + particle.x]
    fld plr.posX
    fsub
    fld const_one
    fld const_one
    fadd
    fld const_one
    fadd
    fmul
    mov temp_int, SCREEN_WIDTH/2
    fiadd temp_int
    fistp screenX
    
    fld REAL4 PTR [esi + particle.y]
    fchs
    fld const_one
    fld const_one
    fadd
    fld const_one
    fadd
    fmul
    mov temp_int, SCREEN_HEIGHT*2/3
    fiadd temp_int
    fistp screenY
    
    ; Draw particle as small rectangle
    mov eax, screenX
    sub eax, 2
    mov ebx, screenY
    sub ebx, 2
    mov ecx, screenX
    add ecx, 2
    mov edx, screenY
    add edx, 2
    
    push eax
    push ebx
    push ecx
    push edx
    
    movzx eax, byte ptr [esi + particle.b]
    shl eax, 16
    movzx ebx, byte ptr [esi + particle.g]
    shl ebx, 8
    or eax, ebx
    movzx ebx, byte ptr [esi + particle.r]
    or eax, ebx
    
    invoke CreateSolidBrush, eax
    push eax
    invoke SelectObject, hdcBack, eax
    push eax
    
    pop edx
    pop ecx
    pop ebx
    pop eax
    
    invoke Rectangle, hdcBack, eax, ebx, ecx, edx
    
    pop eax
    invoke SelectObject, hdcBack, eax
    pop eax
    invoke DeleteObject, eax
    
next_particle_render:
    inc i
    jmp render_particles_loop
    
render_particles_done:
    ret
RenderParticles endp

RenderPlayer proc hdcBack:HDC
    LOCAL hPen:HPEN
    LOCAL oldPen:HPEN
    LOCAL hBrush:HBRUSH
    LOCAL oldBrush:HBRUSH
    LOCAL centerX:DWORD
    LOCAL centerY:DWORD
    LOCAL size:DWORD
    
    ; Draw simplified Sonic
    mov centerX, SCREEN_WIDTH/2
    mov centerY, SCREEN_HEIGHT*2/3
    
    .IF plr.isBoosting == 1
        invoke CreatePen, PS_SOLID, 3, color_boost_trail
    .ELSEIF plr.isSuperSonic == 1
        invoke CreatePen, PS_SOLID, 3, color_super_gold
    .ELSE
        invoke CreatePen, PS_SOLID, 3, color_sonic_blue
    .ENDIF
    mov hPen, eax
    invoke SelectObject, hdcBack, hPen
    mov oldPen, eax
    
    .IF plr.isBoosting == 1
        invoke CreateSolidBrush, color_boost_trail
    .ELSEIF plr.isSuperSonic == 1
        invoke CreateSolidBrush, color_super_gold
    .ELSE
        invoke CreateSolidBrush, color_sonic_blue
    .ENDIF
    mov hBrush, eax
    invoke SelectObject, hdcBack, hBrush
    mov oldBrush, eax
    
    ; Draw body
    mov size, 40
    .IF plr.isSpinDashing == 1
        mov size, 30
    .ENDIF
    
    mov eax, centerX
    sub eax, size
    mov ebx, centerY
    sub ebx, size
    mov ecx, centerX
    add ecx, size
    mov edx, centerY
    add edx, size
    invoke Ellipse, hdcBack, eax, ebx, ecx, edx
    
    invoke SelectObject, hdcBack, oldBrush
    invoke DeleteObject, hBrush
    invoke SelectObject, hdcBack, oldPen
    invoke DeleteObject, hPen
    
    ret
RenderPlayer endp

RenderHUD proc hdcBack:HDC
    LOCAL buffer[64]:BYTE
    LOCAL hFont:HFONT
    LOCAL oldFont:HFONT
    
    ; Create font
    invoke CreateFont, 24, 0, 0, 0, FW_BOLD, 0, 0, 0, \
           DEFAULT_CHARSET, OUT_DEFAULT_PRECIS, CLIP_DEFAULT_PRECIS, \
           DEFAULT_QUALITY, DEFAULT_PITCH or FF_DONTCARE, NULL
    mov hFont, eax
    invoke SelectObject, hdcBack, hFont
    mov oldFont, eax
    
    invoke SetBkMode, hdcBack, TRANSPARENT
    invoke SetTextColor, hdcBack, 00FFFFFFh
    
    ; Draw rings
    invoke wsprintf, ADDR buffer, CTXT("Rings: %d"), plr.rings
    invoke TextOut, hdcBack, 20, 20, ADDR buffer, eax
    
    ; Draw score
    invoke wsprintf, ADDR buffer, CTXT("Score: %d"), plr.score
    invoke TextOut, hdcBack, 20, 50, ADDR buffer, eax
    
    ; Draw speed
    fld plr.speed
    fistp temp_int
    invoke wsprintf, ADDR buffer, CTXT("Speed: %d"), temp_int
    invoke TextOut, hdcBack, 20, 80, ADDR buffer, eax
    
    ; Draw combo
    .IF plr.comboMultiplier > 1
        invoke wsprintf, ADDR buffer, CTXT("Combo x%d"), plr.comboMultiplier
        invoke TextOut, hdcBack, SCREEN_WIDTH/2 - 50, 100, ADDR buffer, eax
    .ENDIF
    
    invoke SelectObject, hdcBack, oldFont
    invoke DeleteObject, hFont
    
    ret
RenderHUD endp

end start

